// Updated Projects.js to match Brittany Chiang-style layout
import { projects } from "../data";
import { FaGithub } from "react-icons/fa";
import React, { useState, useMemo } from "react";
import "./projects.css";

export default function Projects() {
  const [activeTab, setActiveTab] = useState("completed");

  const handleTabChange = (tab) => {
    setActiveTab(tab);
  };

  const completedProjects = projects.filter(p => p.status === "completed");
  const schoolCodeExamples = projects.filter(p => p.category === "School");

  const shuffledCompletedProjects = useMemo(() => {
    const shuffled = [...completedProjects];
    for (let i = shuffled.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
    }
    return shuffled;
  }, [projects]);

  return (
    <section id="projects" className="text-purple-100 bg-gray-900 body-font">
      <div className="container px-4 py-10 mx-auto text-left lg:px-20">
        <div className="flex justify-center mb-10">
          <button
            className={`px-4 py-2 font-bold ${activeTab === "completed" ? "bg-purple-600 text-white" : "bg-gray-800 text-purple-100"} rounded-lg mr-2`}
            onClick={() => handleTabChange("completed")}
          >
            Completed Projects
          </button>
          <button
            className={`px-4 py-2 font-bold ${activeTab === "school" ? "bg-purple-600 text-white" : "bg-gray-800 text-purple-100"} rounded-lg`}
            onClick={() => handleTabChange("school")}
          >
            School Projects
          </button>
        </div>

        {activeTab === "completed" && (
          <div className="project-list space-y-12">
            {shuffledCompletedProjects.map(project => (
              <div key={project.title} className="project-card group transition duration-300">
                <div className="flex flex-col md:flex-row md:items-start gap-6">
                  {project.image && (
                    <img
                      src={project.image}
                      alt={project.title}
                      className="w-full md:w-[220px] rounded shadow-lg"
                    />
                  )}
                  <div>
                    <div className="flex items-center justify-between">
                      <a
                        href={project.link || project.github}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="text-xl font-bold text-purple-100 hover:text-purple-300"
                      >
                        {project.title} <span>â†—</span>
                      </a>
                    </div>
                    {project.subtitle && (
                      <p className="text-purple-400 text-sm mt-1">{project.subtitle}</p>
                    )}
                    <p className="text-purple-300 mt-2 text-sm">{project.description}</p>
                    {project.functions && (
                      <ul className="list-disc list-inside text-sm text-purple-200 mt-2">
                        {project.functions.map((func, idx) => (
                          <li key={idx}>{func}</li>
                        ))}
                      </ul>
                    )}
                    <div className="flex flex-wrap gap-2 mt-4">
                      {project.technologies?.map((tech) => (
                        <span
                          key={tech.name}
                          className="bg-purple-200 text-gray-900 px-2 py-1 rounded text-xs font-medium"
                        >
                          {tech.name}
                        </span>
                      ))}
                    </div>
                    <div className="mt-4 flex gap-4">
                      {project.github && (
                        <a
                          href={project.github}
                          target="_blank"
                          rel="noopener noreferrer"
                          className="text-purple-300 hover:text-white text-sm inline-flex items-center"
                        >
                          <FaGithub className="mr-1" /> Code
                        </a>
                      )}
                      {project.link && (
                        <a
                          href={project.link}
                          target="_blank"
                          rel="noopener noreferrer"
                          className="text-purple-300 hover:text-white text-sm"
                        >
                          Live Site
                        </a>
                      )}
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}

        {activeTab === "school" && (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 mt-10">
            {schoolCodeExamples.map((project) => (
              <div key={project.title} className="p-6 bg-gray-800 rounded-lg shadow-lg">
                <h2 className="text-lg font-bold text-purple-100 text-center mb-4">{project.title}</h2>
                <p className="text-sm text-purple-200">{project.description}</p>
                {project.github && (
                  <a href={project.github} target="_blank" rel="noopener noreferrer" className="block mt-4 text-purple-300 hover:text-white">
                    <FaGithub className="inline-block mr-1" /> View Code
                  </a>
                )}
              </div>
            ))}
          </div>
        )}
      </div>
    </section>
  );
}
